INSERT INTO `products` VALUES (38,'Ração Seca Nutrilus Pro+ Frango & Carne para Cães Adultos','Resumo\r\nNutrilus Pro+ Cães Adultos é uma ração premium especial, desenvolvida por médicos veterinários, com ingredientes selecionados, sem corantes e sem aromatizantes artificiais, garantindo uma alimentação balanceada mais saborosa e nutritiva. Mais sabor, mais proteína e mais nutrição.\r\n\r\nGarantia de Satisfação: Nutrilus acredita que a satisfação é um comprometimento com a vida do pet, e garantimos você e seu pet satisfeitos ou seu dinheiro de volta..*\r\n\r\n- Proteínas de alta qualidade: favorece o ótimo aproveitamento dos nutrientes para a manutenção da musculatura e condição corporal ideal;\r\n- Intestino saudável: com fibras que favorecem uma função intestinal regular;\r\n- Redução do odor das fezes: com extrato de yucca, ideal para ambientes internos;\r\n- Pelagem macia e brilhante: aporte equilibrado de ácidos graxos essenciais, ômegas 3 e 6, vitaminas e minerais;\r\n- Defesa do organismo: enriquecido com DHA que contribui para a redução de inflamações e saúde do coração.\r\n\r\n- Sabor: Frango & Carne\r\n- Embalagem: disponível nas versões de 15kg e 20kg\r\n- Tamanho médio do grão: 13,5mm\r\n- Indicado para: cães adultos de raças médias e grandes\r\n\r\nDetalhes\r\nA Nutrilus é uma marca de ração para cachorros e gatos desenvolvida por médicos veterinários e produzida com ingredientes selecionados, sem corantes e sem aromatizantes artificiais, que oferece uma alimentação balanceada, nutritiva e saborosa ao animal. É uma ração premium especial que proporciona nutrição de alta qualidade com um dos melhores custo-benefício do mercado pet. Perfeita para nutrir e alegrar o seu pet! Você encontra a ração Nutrilus para cachorros filhotes, adultos e idosos e para gatos adultos e castrados.',159.90,1,1),(39,'Ração Seca Nutrilus Pro+ Frango & Carne para Cães Sênior','Resumo\r\nNutrilus Pro Cães Seniors é uma ração premium especial, desenvolvida por médicos veterinários com ingredientes selecionados, sem corantes e sem aromatizantes artificiais, garantindo uma alimentação balanceada e um sabor irresistível, com o melhor custo-benefício.\r\n\r\n- Proteínas de alta qualidade: favorece o ótimo aproveitamento dos nutrientes para a manutenção da musculatura e condição corporal ideal;\r\n- Intestino saudável: com fibras que favorecem uma função intestinal regular;\r\n- Saúde oral: com hexametafosfato de sódio;\r\n- Redução do odor das fezes: com extrato de yucca, ideal para ambientes internos;\r\n- Pelagem macia e brilhante: aporte equilibrado de ácidos graxos essenciais, ômegas 3 e 6, vitaminas e minerais;\r\n- Defesa do organismo: enriquecido com DHA que contribui para a redução de inflamações e saúde do coração;\r\n- Ossos e articulações saudáveis: com condroitina e glicosamina que contribuem para a saúde dos ossos e articulações.\r\n\r\n- Sabor: Frango & Carne\r\n- Embalagem: disponível na versão de 15kg\r\n- Tamanho do grão: 13,5mm\r\n- Indicado para: cães adultos acima de 7 anos raças médias e grandes\r\n\r\n- Garantia de Satisfação: Nutrilus garante você e seu pet satisfeitos - saiba mais abaixo nos detalhes.\r\n\r\nDetalhes\r\nA Ração Seca Nutrilus Pro+ Frango & amp;Carne para Cães Sênior traz nutrição de alta qualidade pelo melhor custo beneficio. Desenvolvido por veterinários a partir de ingredientes selecionados, sem corantes e aromatizantes artificiais, garante uma alimentação balanceada e sabor irresistível.\r\n\r\nPerfeita para nutrir e alegrar o seu cão! Benefícios:\r\n- Intestino saudável;\r\n- Reduz o odor das fezes;\r\n- Proteínas de alta qualidade;\r\n- Pelagem mais macia e brilhante.\r\n\r\nNutrilus garante você e seu pet satisfeitos: a nutrição dos cães e gatos e satisfação dos tutores são nossos maiores objetivos. Por isso, oferecemos o programa garantia de satisfação. Para saber mais, entre em contato pelo telefone 3003-5052 ou pelo e-mail contato@nutrilus.com.br, disponível de segunda a sexta das 9h às 17h. Para mais informações acesse: www.nutrilus.com.br.\r\n\r\n',172.90,1,1),(40,'Ração Seca True para Cães Adultos Raças Médias e Grandes','Resumo\r\nInspirada no amor que sentimos por eles, a True foi desenvolvida para oferecer a melhor alimentação para os nossos pets.\r\n\r\n- Ração natural feita com ingredientes deliciosos: frango, batata-doce, brócolis, cenoura e arroz integral;\r\n- Feita com carne de verdade, sem farinha de vísceras;\r\n- Sem transgênicos, sem corantes e sem conservantes artificiais;\r\n- Saudável e nutritiva, enriquecida com Natural Complex: composto natural rico em extratos herbais, algas, fibras e prebióticos para reforçar as defesas do organismo;\r\n\r\n- Ingredientes funcionais:\r\n- Hexametamosfato de sódio para prevenção de tártaro;\r\n- Extrato de yucca para redução do odor das fezes;\r\n- Condroitina e glicosamina para saúde das articulações;\r\n- Com fibras e prebióticos para a saúde intestinal;\r\n\r\nTrue Amor de Verdade, Ingredientes de Verdade.\r\n\r\n- Este produto possui Satisfação Garantida. Saiba mais abaixo na descrição\r\n\r\nDetalhes\r\nA Ração Seca True para Cães Adultos Raças Médias e Grandes é um alimento completo e super premium natural.\r\n\r\n- Feita com ingredientes naturais e deliciosos: frango, batata-doce, brócolis, cenoura e arroz integral;\r\n- Feita com carne de verdade, sem farinha de vísceras;\r\n- Sem transgênicos, corantes e conservantes artificiais;\r\n- Enriquecido com Natural Complex: composto natural rico em extratos herbais, algas, fibras e prebióticos para reforçar as defesas do organismo;\r\n- Saúde oral: com hexametafosfato de sódio;\r\n- Redução do odor das fezes: com extrato de yucca;\r\n- Saúde das articulações: com condroitina e glicosamina.\r\n\r\nTrue\r\nAmor de Verdade, Ingrediente de Verdade.\r\n\r\nPara mais informações acesse: www.truefoods.com.br\r\nDúvidas entre em contato com contato@truefoods.com.br\r\n\r\nSolicitações referentes à Garantia de Satisfação devem ser encaminhadas diretamente à True Foods por meio do telefone (11) 3135 6555.',284.90,1,1),(41,'Ração Seca Magnus Todo Dia Carne para Cães Adultos','Resumo\r\n- Vitamina E e Selênio Quelato: antioxidantes que atuam no combate aos radicais livres;\r\n- Ômegas 3 e 6, biotina, zinco quelato: promovem a beleza e saúde da pele e pelagem;\r\n- Receita composta por ingredientes que auxiliam no fluxo e equilíbrio da flora intestinal;\r\n- Proteína de alto valor agregado com maior absorção e aproveitamento pelo organismo.\r\n\r\nDetalhes\r\nA Ração Seca Magnus Todo Dia Carne para Cães Adultos contém ingredientes que proporcionam um alimento com todos os nutrientes essenciais e importantes para a qualidade de vida do seu cachorro. Formulada com precisão para atender as exigências do pet adulto, acima de 12 meses, de qualquer raça, em fase de manutenção. Nutritiva e saborosa, agrada aos paladares exigentes e promove longevidade e benefícios para a saúde.',144.90,1,1),(42,'Ração Seca Liva Super Premium para Cães Adultos de Raças Pequenas','Resumo\r\nA Liva é uma ração Super Premium que promove uma vida mais saudável para os nossos pets. Existimos para proporcionar nutrição e bem-estar para que eles vivam cada vez mais e melhor.\r\n\r\n- Ração Super Premium para cães adultos de porte pequeno;\r\n- Sabor Frango, Arroz, Cenoura e Espinafre;\r\n- Alimento rico em nutrientes e proteínas de alta qualidade;\r\n- Com ômega 3 e 6, Liva ajuda a manter a pele saudável e uma pelagem brilhante e macia;\r\n- A inclusão de fibras e prebióticos selecionados contribui para o bom funcionamento do intestino;\r\n- Presença de aminoácidos essenciais que promovem a manutenção das funções vitais;\r\n- Com extrato de yucca, zeolita, fibras e prebióticos reduz o odor e volume das fezes;\r\n- Alimento rico em vitaminas e minerais que ajudam a fortalecer o sistema imunológico;\r\n\r\n- Este produto possui Satisfação Garantida. Saiba mais abaixo na descrição.\r\n\r\nDetalhes\r\nA Ração Seca Liva Super Premium para Cães Adultos de Raças Pequenas é feita com ingredientes selecionados e de alta qualidade, que promovem uma vida mais saudável para nossos pets. Desenvolvida em parceria com médicos-veterinários, a Liva possui fórmulas balanceadas que oferecem diversos benefícios para a manutenção das funções vitais, desde o fortalecimento da imunidade, prevenção de doenças até uma pele e pelagem mais saudável. A receita de Liva combina os melhores ingredientes naturais, sem corantes artificiais, garantindo muito sabor e saciedade.\r\n\r\nA Liva Super Premium é feita para quem sabe que a nutrição é dos maiores gestos de cuidado que podemos oferecer aos nossos pets. E também para quem não quer abrir mão de praticidade, sabor e nem de custo-benefício.\r\n\r\nPara mais informações acesse: www.livapet.com.br\r\nAcompanhe a Liva no Instagram: @liva.pet\r\nDúvidas entre em contato com contato@livapet.com.br\r\n\r\n\r\nAs solicitações referentes à Garantia de Satisfação devem ser encaminhadas diretamente à Liva por meio do telefone (11) 4800-3973.',309.90,1,1),(43,'Ração Seca Nutrilus Pro+ Frango & Carne para Cães Adultos de Raças Pequenas','Resumo\r\nNutrilus Pro+ Cães RaçasPequenas é uma ração premium especial, desenvolvida por médicos veterinários, com ingredientes selecionados, sem corantes e sem aromatizantes artificiais, garantindo uma alimentação balanceada mais saborosa e nutritiva. Mais sabor, mais proteína e mais nutrição.\r\n\r\nGarantia de Satisfação: Nutrilus acredita que a satisfação é um comprometimento com a vida do pet, e garantimos você e seu pet satisfeitos ou seu dinheiro de volta.\r\n\r\n- Proteínas de alta qualidade: favorece o ótimo aproveitamento dos nutrientes para a manutenção da musculatura e condição corporal ideal;\r\n- Intestino saudável: com fibras que favorecem uma função intestinal regular;\r\n- Redução do odor das fezes: com extrato de yucca, ideal para ambientes interno;\r\n- Pelagem macia e brilhante: aporte equilibrado de ácidos graxos essenciais, ômegas 3 e 6, vitaminas e minerais;\r\n- Partícula adaptada: tamanho ideal para a correta preensão e mastigação;\r\n- Defesa do organismo: enriquecido com DHA que contribui para a redução de inflamações e saúde do coração.\r\n\r\n- Sabor: Frango & Carne\r\n- Embalagem: disponível na versão de 15kg\r\n- Tamanho médio do grão: 7,5mm\r\n- Indicado para: cães adultos de raças pequenas\r\n\r\nDetalhes\r\nA Nutrilus é uma marca de ração para cachorros e gatos desenvolvida por médicos veterinários e produzida com ingredientes selecionados, sem corantes e sem aromatizantes artificiais, que oferece uma alimentação balanceada, nutritiva e saborosa ao animal. É uma ração premium especial que proporciona nutrição de alta qualidade com um dos melhores custo-benefício do mercado pet. Perfeita para nutrir e alegrar o seu pet! Você encontra a ração Nutrilus para cachorros filhotes, adultos e idosos e para gatos adultos e castrados.\r\n\r\nNutrilus garante você e seu pet satisfeitos: a nutrição dos cães e gatos e satisfação dos tutores são nossos maiores objetivos. Por isso, oferecemos o programa garantia de satisfação. Para saber mais, entre em contato pelo telefone (11) 2853-0131 ou pelo e-mail contato@nutrilus.com.br, disponível de segunda a sexta das 9h às 17h. Para mais informações acesse: www.nutrilus.com.br.\r\n\r\n',160.90,1,1),(44,'Ração Seca PremieR Pet Golden Gatos Adultos Castrados Carne','Resumo\r\n- Sabor inigualável: oferece máxima satisfação para paladares exigentes;\r\n- Trato urinário saudável: minerais balanceados e controle do pH urinário;\r\n- Controle do ganho de peso: contém L-carnitina e teores reduzidos de calorias e gorduras;\r\n- Redução do odor das fezes: seleção de ingredientes especiais que auxiliam na redução do odor das fezes.\r\n\r\n- Este produto possui Satisfação Garantida. Saiba mais abaixo na descrição.\r\n\r\nDetalhes\r\nProcedimento cada vez mais recomendado pelos médicos veterinários, a castração promove inúmeros benefícios, mas também alterações fisiológicas que exigem alguns cuidados extras com a dieta do seu gato. Especialmente formulada para atender às necessidades dos gatos castrados, a Ração Seca PremieR Pet Golden Gatos Adultos Castrados Carne auxilia na prevenção da obesidade e no cuidado com o trato urinário, garantindo uma nutrição ótima e saudável.\r\n\r\nSolicitações referentes à Garantia de Satisfação devem ser encaminhadas diretamente para o fabricante por meio do PremieR Responde – Telefone 0800 055 66 66. Para mais informações acesse: https://www.premierpet.com.br/garantia-premierpet/',171.90,1,1);
